INSERT INTO `spm_problems` (`id`, `enabled`, `difficulty`, `catId`, `name`, `description`, `debugTimeLimit`, `debugMemoryLimit`, `input`, `output`) VALUES
(1001, 1, 1, 1, 'Hello, world!', 'Написать программу, выводящую на экран приветствие &quot;Hello, world!&quot;', 250, 20971520, '', 'В выходной поток вывести единственную строку: \"Hello, world!\".'),
(1002, 1, 1, 1, 'A+B', 'Вывести на экран сумму чисел A и B', 200, 20971520, 'Во входном потоке даны через пробел 2 числа: 0', 'В выходной поток вывести сумму чисел, данных во входном потоке.'),
(1003, 1, 1, 1, 'C+D', 'Вывести на экран сумму вещественных чисел C и D', 300, 30971520, 'Во входном потоке даны через пробел 2 вещественных числа: 0', 'В выходной поток вывести сумму чисел, данных во входном потоке с 3 цифрами после запятой.'),
(1004, 1, 2, 6, 'Простой вывод', 'Вывести данный массив в выходной поток.', 200, 20971520, 'В первой строке входного потока задано натуральное число N - количество элементов целочисленного массива (N < 1000). \r\nВо второй строке перечислены через пробел значения элементов массива Ai (-32000 < Ai < 32000)', 'Вывести в столбик значения всех элементов заданного массива в прямом порядке.'),
(1005, 1, 2, 6, '201. Поиск наименьшего', 'Дана последовательность чисел. Найти в ней наименьшее число.', 200, 20971520, 'Задано сначала число N (количество чисел в последовательности), а затем\r\nN чисел. Все числа - из диапазона Integer. N<=100', 'Выведите наименьшее число.'),
(1006, 1, 4, 6, '202. Вывести одиноких', 'Даны два массива чисел. Требуется вывести в выходной файл те элементы\r\nпервого массива (в том порядке, в каком они идут в первом массиве),\r\nкоторых нет во втором массиве.', 200, 20971520, 'Во входном файле записано сначала число N - количество элементов в первом\r\nмассиве, затем N чисел - элементы массива. Затем записано число M - количество\r\nэлементов во втором массиве. Затем записаны элементы второго массива.\r\nКоличество элементов каждого массива не превышает 100. Сами элементы - \r\nчисла из диапазона Longint.', 'В выходной файл выведите те элементы первого массива, которых нет во втором в \r\nтом порядке, в каком они идут в первом массиве.'),
(1007, 1, 6, 6, '203. День рождения Владыки', 'Главный повар решил устроить в Гимназии 28 День рождения Владыки Sirkadirov-а. Для этого он приготовил гимназистам N необычайно вкусных пицц и втайне \r\nпостановил, что первый пожаловавший отведать поварское кушанье школьник \r\nдолжен получить наибольшее количество вкусных пицц, а каждый последующий - \r\nстрого меньше, чем предыдущий (повару очень не нравилось, когда к \r\nприготовленному им обеду опаздывали и тот вынужден был остывать).\r\n<br/>\r\nКонечно, введенное правило оставляет существенный произвол в числе пицц, \r\nполучаемых очередным явившимся гимназистом, и это число не в последнюю очередь будет зависеть от отношения Sirkadirovа к гимназисту, а также \r\nот волшебных слов, произносимых им в честь Sirkadirovа. Например, 6 пицц могут быть в результате распределены по одной из следующих четырех схем: \r\n3+2+1 (три пиццы первому из пришедших школьников, две - второму и \r\nодну - третьему), 4+2, 5+1 и 6 (все пиццы съедает счастливчик, \r\nпришедший первым).\r\n<br/>\r\nПовар просит вас написать программу, определяющую, каким количеством различных \r\nспособов повар может распределить приготовленное лакомство среди школьников.', 200, 20971520, 'Входной файл содержит одно целое число N - количество приготовленных \r\nповаром пицц (0<=N<=200).', 'Выходной файл должен содержать одно целое число типа longint, равное количеству возможных распределений пицц.'),
(1008, 1, 50, 19, '237. Регулярные выражения', 'Требуется определить подходит ли заданное слово под заданный шаблон. Шаблон задается большими латинскими буквами, знаками &quot;?&quot; - любой символ, &quot;*&quot; - любая последовательность символов (даже пустая).', 200, 20971520, 'в первых двух строках записаны шаблон и слово: в одной строки записан шаблон - последовательность больших \r\nлатинских букв, \"?\" и \"*\", в другой  - слово, состоящее только \r\nиз больших латинских букв (строки короче 100 символов).', 'вывести YES, если слово подходит или NO, если нет.'),
(1009, 1, 2, 3, 'Шахматная тоска', 'Даны координаты двух полей шахматной доски \r\n(координаты клетки - это 2 числа от 1 до 8: номер столбца и номер строки)\r\n\r\nОдного ли цвета эти клетки на шахматной доске? Вывести в выходной поток\r\nЕДИНСТВЕННУЮ СТРОКУ, содержащую YES, если они одного цвета, и NO в противном случае.', 200, 20971520, 'Во входном потоке даны 4 числа типа byte.', 'Вывести в выходной поток\r\nЕДИНСТВЕННУЮ СТРОКУ, содержащую YES, если они одного цвета, и NO в противном случае.'),
(1012, 1, 10, 8, '218. Распаковка строки', 'Будем рассматривать только строчки, состоящие из заглавных латинских букв. Например, рассмотрим строку AAAABCCCCCDDDD. Длина этой строки равна 14. Поскольку строка состоит только из латинских букв, повторяющиеся символы могут быть удалены и заменены числами, определяющими количество повторений. Таким образом, данная строка может быть представлена как 4AB5C4D. Длина такой строки 7. Описанный метод мы назовем упаковкой строки.  Напишите программу, которая берет упакованную строчку и восстанавливает по ней исходную строку.', 200, 20971520, 'Входной поток содержит одну упакованную строку. В строке могут встречаться только конструкции вида nA, где n - количество повторений символа (целое число от 2 до 99), а A - заглавная латинская буква, \r\nлибо конструкции вида A, то есть символ без числа, определяющего количество повторений. Максимальная длина строки не превышает 80.', 'В выходной поток выведите восстановленную строку. При этом строка должна быть разбита на строчки длиной ровно по 40 символов (за исключением последней, которая может содержать меньше 40 символов).');

