  `city` tinytext,
  `school` tinytext,
  `phone` tinytext,
  `group` tinytext NOT NULL,
  `banned` tinyint(4) NOT NULL DEFAULT '0',
  `associatedOlymp` bigint(20) UNSIGNED NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

